import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { Alert, Platform, Pressable, StyleSheet, Text, TouchableHighlight, FlatList, View } from 'react-native';
import FlatListBasics from './Components/FlatList';

const STATUS_BAR_HEIGHT = Platform.select({ios:20, android:24});

const FridgeScreen = ({navigation}) => {

    return (
        <View style={styles.container}>
            <View style={{ height: STATUS_BAR_HEIGHT}} />
        <View style={styles.topBarContainer}>
          <Text style={styles.titleStyle}>Hladilnik</Text>
        </View>
        <View style={styles.mainContainer}>
        <View style={styles.listContainer}>
        <FlatList
          data={[
            {key: 'Devin'},
            {key: 'Dan'},
            {key: 'Dominic'},
            {key: 'Jackson'},
            {key: 'James'},
            {key: 'Joel'},
            {key: 'John'},
            {key: 'Jillian'},
            {key: 'Jimmy'},
            {key: 'Julie'},
          ]}
          renderItem={({item}) => {<Pressable onPress={onClick}>
            <Text style={styles.item}>{item.key}</Text>
          </Pressable>}}
        />
      </View>
        </View>
        </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'transparent',
    alignItems: 'center',
    justifyContent: 'center',
  },
  topBarContainer:{
      flex:1,
      backgroundColor:"transparent",
      justifyContent:"center",
      alignItems:"center",
      borderBottomWidth:1
 },
 pressableStyle:{
     flex:1,
    alignItems:"center",
    justifyContent:"center",
    borderColor:"gray",
    borderWidth:1,
 },

 mainContainer:{
    flex:8,
    backgroundColor:'blue',
  },
  titleStyle: {
    fontSize: 20,
    textAlign:'center',
  },listContainer: {
    flex: 1,
    paddingTop: 22
   },
   item: {
     padding: 10,
     fontSize: 18,
     height: 44,
   },
});
export default FridgeScreen
